import React from "react";
import { useState } from "react";
import hat1 from ""

function ZIndex() {
    const[zIndex, setZIndex] = useState();
    console.log('zIndex: ' + {zIndex})
    return (
        <div>
            <div onClick={() => {
                setZIndex(zIndex + 1)
                console.log('zIndex: ')
            }
            }/>
            <div className="box handle">
                <div className="">
                    
                <img className="hat" src={hat1} alt="Hat"></img>
                    
                </div>
            </div>
        </div>
    )
}

export default ZIndex;
